description:
Here are 5 episodes of the PBS kids' show Dragon Tales. They have been ripped from the DVD release &quot;Believe in Yourself&quot; (2004). The titles are as follows:

&quot;Balancing Act&quot;
&quot;Head Over Heals&quot;
&quot;Just for Laughs&quot;
&quot;Lucky Stone&quot;
&quot;On Thin Ice&quot;

The episodes have language tracks in English and Spanish.

Video:  1576-2097 Kbps, 640*480 (4:3) at 29.970 fps, MPEG-4 (XviD)
Audio: 313 Kbps, 48000 Hz, 2 channels, MPEG (MP3) (Version 1) Layer-3, Joint stereo
